import React, { useEffect } from 'react';
import './ProjectSection.css';

function ProjectSection() {
  useEffect(() => {
    const checkboxes = document.querySelectorAll('input[type="checkbox"]');
    const items = document.getElementById('items').querySelectorAll('.card');

    function filterItems() {
      const selectedOptions = Array.from(checkboxes)
        .filter(checkbox => checkbox.checked)
        .map(checkbox => checkbox.value);

      items.forEach(item => {
        if (selectedOptions.length === 0 || selectedOptions.includes(item.dataset.category)) {
          item.classList.add('show');
        } else {
          item.classList.remove('show');
        }
      });
    }

    checkboxes.forEach(checkbox => checkbox.addEventListener('change', filterItems));

    return () => {
      checkboxes.forEach(checkbox => checkbox.removeEventListener('change', filterItems));
    };
  }, []);

  return (
    <>
      <div>
        <label>Filter:</label>
        <div>
          <input type="checkbox" id="health" value="health" />
          <label htmlFor="health">Health</label>
        </div>
        <div>
          <input type="checkbox" id="education" value="education" />
          <label htmlFor="education">Education</label>
        </div>
        <div>
          <input type="checkbox" id="environment" value="environment" />
          <label htmlFor="environment">Environment</label>
        </div>
      </div>
      <div id="items">
        <h2>Items:</h2>
        <ul>
          <li className="card health" data-category="health">
            <div className="card-content">
              <h3>Health Project</h3>
              <p>Some description about a health project.</p>
            </div>
          </li>
          <li className="card education" data-category="education">
            <div className="card-content">
              <h3>Education Initiative</h3>
              <p>Some description about an education initiative.</p>
            </div>
          </li>
          <li className="card environment" data-category="environment">
            <div className="card-content">
              <h3>Environmental Campaign</h3>
              <p>Some description about an environmental campaign.</p>
            </div>
          </li>
          <li className="card health" data-category="health">
            <div className="card-content">
              <h3>Medical Research</h3>
              <p>Some description about a medical research project.</p>
            </div>
          </li>
          <li className="card education" data-category="education">
            <div className="card-content">
              <h3>Scholarship Program</h3>
              <p>Some description about a scholarship program.</p>
            </div>
          </li>
          <li className="card environment" data-category="environment">
            <div className="card-content">
              <h3>Sustainable Development</h3>
              <p>Some description about sustainable development initiatives.</p>
            </div>
          </li>
        </ul>
      </div>
    </>
  );
}

export default ProjectSection;
